import { Component } from "react";
import DashboardHead from '../../layouts/Dashboard/DashboardHead';
import DashboardBody from '../../layouts/Dashboard/DashboardBody';
import Main from '../../layouts/Dashboard/Main';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class HomeView extends Component {

    render(){
        return(
            <div>
                <DashboardHead title="Dashboard Home"/>
                <DashboardBody >
                    <Main>
                    <div className="content">
                        <div className="container-fluid">
                        <div className="row">
                            <div className="col-lg-3 col-md-6 col-sm-6">
                            <h1>home dashboard <Link to="/history"></Link></h1>
                            </div>
                        </div>
                        </div>
                    </div>
                    </Main>
                </DashboardBody>
            </div>
        )
    }

}

export default HomeView;
